import React from 'react'
import { View, Text } from 'react-native'

const validationSchema = yup.object({
    email: yup.string().trim().label('Email').email().required("Email field is empty"),

    password: yup.string().label('Password').email().required("Email field is empty"),

})
export default function Signup() {
    return (
        <View>
            <Text>Signup</Text>
        </View>
    )
}
